import React, { useState } from 'react';
import { Affix, Button } from 'antd';
import './Nav.css'

const Nav = () => {
  const [top, setTop] = useState(10);
  return (
    <>
      <Affix offsetTop={top}>
        <Button type="primary">
          Affix top
        </Button>
      </Affix>
      <br />
    </>
  );
};

export default Nav;
